import React, {Component} from "react";
import './A_bit_about_me.css';
import img from './About_me_img.png';

class A_bit_about_me extends Component {
    render() {
        return (
            <div className="Main_about">
                <div className="About_phone_pic">
                    <img src={img} alt="phone_pic_here" width={"400px"}/>
                </div>
                <div className="About_text"></div>
            </div>
        );
    }
}

export default A_bit_about_me;
